def bytearray_copy(destino: bytearray, fuente: bytearray, num_bytes: int) -> None:
    # Determinar la cantidad real de bytes a copiar (no más de lo disponible en 'fuente' y no más que el espacio restante en 'destino')
    start = 0
    end = min(num_bytes, len(fuente))

    if num_bytes > len(destino):
        num_bytes_copiar = len(destino)
    else:
        num_bytes_copiar = num_bytes

    # Copiamos los primeros 'end' bytes de fuente a destino, pero si el número total a copiar es menor que end, lo ajustamos.
    if start < end and num_bytes_copiar > 0:
        datos_fuente = fuente[:num_bytes]
        if len(datos_fuente) == 0:
            return
        # Asignamos los primeros 'num_bytes' de destino a ser la copia de los bytes iniciales de fuente.
        if num_bytes <= len(destino):
            # Copiamos exactamente num_bytes
            destino[:num_bytes] = datos_fuente
        else:
            # Si num_bytes es mayor que el tamaño de destino, entonces llenamos todo el destino y sobra en fuente (pero no se copia)
            destino[:] = datos_fuente  # Esto asigna los bytes disponibles hasta llenar 'destino'
    else:
        print("Error: No hay suficientes bytes para copiar.")

