def strlen(s):
    return len(s)

def memcpy(destination, source, num_bytes):
    # التحقق من أن المصدر ووجهة هما كلاهما bytearray أو يمكن تحويلهما إلى bytearray
    if not isinstance(source, (str, bytes)):
        raise TypeError("Source must be a string or bytes")

    # تحويل السلسلة النصية المُعطاة إلى bytearray إذا كانت نصية
    if isinstance(source, str):
        source_bytes = source.encode()
    else:
        source_bytes = source

    # التحقق من أن الوجهة هي bytearray
    if not isinstance(destination, bytearray):
        raise TypeError("Destination must be a bytearray")

    # نسخ عدد البايتات المطلوب
    for i in range(num_bytes):
        destination[i] = source_bytes[i]

    return destination

# مثال الاستخدام:
if __name__ == "__main__":
    # أنشئ وجهة bytearray بحجم كافٍ لاستيعاب "Hello"
    dest = bytearray(5)  # يجب أن يكون الوجهة bytearray بنفس الحجم أو أكبر

    source_str = "Hello"  # السلسلة المصدر

    # استخدم memcpy للنسخ
    memcpy(dest, source_str, strlen(source_str))

    # تحويل الوجهة إلى سلسلة نصية وطباعتها
    dest_decoded = dest.decode('utf-8')
